export default function Admin() {
  return (
      <div className="container">
        <div className="header">Admin</div>
        <div className="content_box">
        	<form action="" method="post">
            	<input id="user" name="user" type="text" className="login_tf" maxlength="16" />
            	<input id="pass" name="pass" type="password" className="login_tf" maxlength="16" />
                <div className="login_button">Login</div>
            </form>
        </div>
    <style jsx global>{`
        body{
            margin:0px;
            padding:0px;
            width:100%; 
            height:100%;
        }
        .container{
            height:100%;
        }
        .header{
            height:28px;
            padding:8px;
            background-color:#006; 
            color:#FFF;
	        line-height:28px;
        }
        .content_box{
            height:calc(100% - 60px);
            padding:8px;
        }
        .login_button{
            padding:4px 12px 4px 12px;
            background-color:#006; 
            color:#FFF;
            border-radius:8px;
            margin-top:8px;
        }
        .login_tf{
            padding:4px 12px 4px 12px;
            text-align:center;
            border-radius:8px;
            margin-top:8px;
        }
    `}</style>
      </div>
  );
}
